import React from "react"
import { ProjectsData, ProjectsNav } from "./Data"

const ProjectList = () => {
    return (
        <div className="work__filters">
            {ProjectsNav.map((item, index) => {
                return (
                    <span className="projectlist__item"></span>
                )
            })}
        </div>
    )
}

export default ProjectList
